import React from 'react';
import './StudentInterface.css'; // Import the CSS file

function StudentInterface() {
  return (
    <div className="dashboard-container">
    <img src={require('../assest/R3.jpg')} alt="Students" className="background-image" />
      <div className="button-overlay">
        <button className="dashboard-button">Update Your Details</button>
        <button className="dashboard-button">Delete Current Courses</button>
        <button className="dashboard-button1">View Available Courses</button>
        <button className="dashboard-button2">View Your Course Details</button>
      </div>
    </div>
  );
}

export default StudentInterface;
